  true,\n\t\"url\": null,\n\t\"notes\": \"Dual Enrollment Programs and Courses for
  High School Students, 2010-11 (PEQIS 18), is part of the Postsecondary Education
  Quick Information System (PEQIS); program data is available since 1997 at <http://nces.ed.gov/surveys/peqis/>.
  The study was conducted using paper surveys, non-computer-assisted telephone instruments,
  and email. Postsecondary institution personnel were sampled for this survey. The
  studyufffds weighted response rate was 94 percent. Key statistics produced from
  PEQIS 18 are on the prevalence and characteristics of dual enrollment programs at
  postsecondary institutions in the United States.\",\n\t\"license_title\": \"Creative
